let globalSignPad = null;

document.addEventListener("DOMContentLoaded", async () => {
    initSignPad();
    initDefaultValues();
    document.getElementById('templateForm').addEventListener('submit', handleGenerate);
    initActionButtons();
});

function initDefaultValues() {
    // get query param "TypeAG" and check the correct value
    const urlParams = new URLSearchParams(window.location.search);
    {
        const typeAG = urlParams.get('typeAg');
        console.log(typeAG);
        switch (typeAG) {
            case 'AGO-AGE':
                document.getElementById('TypeAG3').checked = true;
                break;
            case 'AGE':
                document.getElementById('TypeAG2').checked = true;
                break;
            default:
                document.getElementById('TypeAG1').checked = true;
                break;
        }
    }
    {
        const dateAg = urlParams.get('dateAg');
        if (dateAg){
            document.getElementById('DateReu').value = dateAg;
        }
    }
    {
        const currentDate = (new Date()).toISOString().split('T')[0];
        document.getElementById('Today').value = currentDate;
    }
}

function initSignPad() {
    const sketch = new SketchLite('signaturePad', {
        bgcolor: 'white',
        lineWidth: 2,
        color: 'black',
        multi: false
    });
    globalSignPad = sketch;
    document.getElementById('clear').addEventListener('click', (event) => {
        event.preventDefault();
        sketch.clear();
    });
}

const dayFormatter = new Intl.DateTimeFormat('fr-FR', {
    day: '2-digit',
    month: '2-digit',
    year: 'numeric'
});
const timeFormatter = new Intl.DateTimeFormat('fr-FR', {
    hour: '2-digit',
    minute: '2-digit'
});


function handleGenerate(event) {
    event.preventDefault();    
    const dataManager = new FormData(event.target);
    const data = new Map(dataManager.entries());
    
    const space = data.get('Discord') ? ` '${data.get('Discord')}' ` : '';
    const dateReu = new Date(data.get('DateReu'));
    const todayDate = new Date(data.get('Today'));
    props.NomEtPrenom.value = `${data.get('Prenom')}${space}${data.get('Nom')}`;
    props.Role.value = data.get('Role');
    props.TypeAG.value = data.get('TypeAG');
    props.JJMMAAAA.value = dayFormatter.format(dateReu);
    props.HHMM.value = timeFormatter.format(dateReu);
    props.NomDerogatoire.value = data.get('NomDerogatoire');
    props.Raison.value = data.get('Raison');
    props.Today.value = dayFormatter.format(todayDate);
    props.ImgPng.value = globalSignPad.toDataUrl();

    let svgContent = "" + templateDerogationMinSvg;
    for (const item of Object.values(props)) {
        svgContent = svgContent.replaceAll(item.token, item.value);
    }
    
    document.getElementById('svgContainer').innerHTML = svgContent;
    document.getElementById('instructions').classList.remove('is-hidden');
    return false;
}

function initActionButtons() {
    document.getElementById('downloadPDF').addEventListener('click', (event) => {
        event.preventDefault();
        window.print();
    });

    document.getElementById('downloadSVG').addEventListener('click', (event) => {
        event.preventDefault();
        const svg = document.getElementById('svgContainer').innerHTML;
        const blob = new Blob([svg], { type: 'image/svg+xml' });
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'derogation.svg';
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
    });

    document.getElementById('autosign').addEventListener('click', (event) => {
        event.preventDefault();
        autosign();
    })
}

function autosign() {
    console.log("autosign");

    const canvas = document.getElementById('signaturePad');
    const ctx = canvas.getContext('2d');
    ctx.font = '16px Arial';
    ctx.textAlign = 'center';
    ctx.fillStyle="black";
    
    ctx.strokeStyle = 'white';
    ctx.lineWidth = 2;

    const prenom = document.getElementById('Prenom').value;
    const nom = document.getElementById('Nom').value;
    const name = `${prenom} ${nom}`;

    ctx.strokeText(name, canvas.width / 2, canvas.height / 2);
    ctx.fillText(name, canvas.width / 2, canvas.height / 2);

    const timestamp = new Date().toLocaleString();
    ctx.font = '12px Arial';
    ctx.strokeText(timestamp, canvas.width / 2, canvas.height / 2 + 20);
    ctx.fillText(timestamp, canvas.width / 2, canvas.height / 2 + 20);

    ctx.font = '10px Arial';
    ctx.strokeText('Signé numériquement', canvas.width / 2, canvas.height / 2 - 20);
    ctx.fillText('Signé numériquement', canvas.width / 2, canvas.height / 2 - 20);
}

